import React, { PropsWithChildren } from 'react';
import TodoElement from './TodoElement';

// type Props = PropsWithChildren<{
//   todos: any;
// }>;

export default function TodoContainer(props: any) {
  console.log(props);
  const { todos } = props;
  return (
    <table>
      <thead>
        <tr>
          <th>Todo Title</th>
          <th>Description</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {todos.map((todo: any) => (
          <TodoElement key={todo.id} todo={todo} />
        ))}
      </tbody>
    </table>
  );
}
